INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3760150441128', 'Huile D\'olive', 'La Maison Auffan, fondée à Marseille en 1875 par C Jean Baptiste Auffan, a fait toute sa réputation autour de son huile d\'olive. A l\'origine, les charrettes de la Maison Auffan approvisionnaient les villages et les fermes autour de Marseille. Aujourd\'hui encore, nous perpétuons cette tradition de qualité et de service. Notre huile Biologique vierge extra est le fruit d\'un assemblage minutieux, Elle est produite à partir d\'olives préssées immédiatement après leur récolte, Huile pour assaisonnement et cuisson. (Température maximale conseillée 1800) Tenir à l\'abris de la lumière et de la chaleur,', 'https://static.openfoodfacts.org/images/products/376/015/044/1128/front_fr.4.400.jpg', '100', '17', '0', '0', '', '0', '0', '0', '', '0');

